INSERT INTO `Products` VALUES (1,'Apple Juice (1000ml)','The all-time classic.',2,1,'apple_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(2,'Orange Juice (1000ml)','Made from oranges hand-picked by Uncle Dittmeyer.',3,2,'orange_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(3,'Eggfruit Juice (500ml)','Now with even more exotic flavour.',9,9,'eggfruit_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(4,'Raspberry Juice (1000ml)','Made from blended Raspberry Pi, water and sugar.',5,5,'raspberry_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(5,'Lemon Juice (500ml)','Sour but full of vitamins.',3,2,'lemon_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(6,'Banana Juice (1000ml)','Monkeys love it the most.',2,2,'banana_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(7,'OWASP Juice Shop T-Shirt','Real fans wear it 24/7!',22,22,'fan_shirt.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(8,'OWASP Juice Shop CTF Girlie-Shirt','For serious Capture-the-Flag heroines only!',22,22,'fan_girlie.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(9,'OWASP SSL Advanced Forensic Tool (O-Saft)','O-Saft is an easy to use tool to show information about SSL certificate and tests the SSL connection according given list of ciphers and various SSL configurations. <a href=\"https://www.owasp.org/index.php/O-Saft\" target=\"_blank\">More...</a>',0,0,'orange_juice.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(10,'Christmas Super-Surprise-Box (2014 Edition)','Contains a random selection of 10 bottles (each 500ml) of our tastiest juices and an extra fan shirt for an unbeatable price! (Seasonal special offer! Limited availability!)',30,30,'undefined.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(11,'Rippertuer Special Juice','Contains a magical collection of the rarest fruits gathered from all around the world, like Cherymoya Annona cherimola, Jabuticaba Myrciaria cauliflora, Bael Aegle marmelos... and others, at an unbelievable price! <br/><span style=\"color:red;\">This item h',17,17,'undefined.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(12,'OWASP Juice Shop Sticker (2015/2016 design)','Die-cut sticker with the official 2015/2016 logo. By now this is a rare collectors item. <em>Out of stock!</em>',1000,1000,'sticker.png','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(13,'OWASP Juice Shop Iron-Ons (16pcs)','Upgrade your clothes with washer safe <a href=\"https://www.stickeryou.com/products/owasp-juice-shop/794\" target=\"_blank\">iron-ons</a> of the OWASP Juice Shop or CTF Extension logo!',15,15,'iron-on.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(14,'OWASP Juice Shop Magnets (16pcs)','Your fridge will be even cooler with these OWASP Juice Shop or CTF Extension logo <a href=\"https://www.stickeryou.com/products/owasp-juice-shop/794\" target=\"_blank\">magnets</a>!',16,16,'magnets.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(15,'OWASP Juice Shop Sticker Page','Massive decoration opportunities with these OWASP Juice Shop or CTF Extension <a href=\"https://www.stickeryou.com/products/owasp-juice-shop/794\" target=\"_blank\">sticker pages</a>! Each page has 16 stickers on it.',10,10,'sticker_page.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(16,'OWASP Juice Shop Sticker Single','Super high-quality vinyl <a href=\"https://www.stickeryou.com/products/owasp-juice-shop/794\" target=\"_blank\">sticker single</a> with the OWASP Juice Shop or CTF Extension logo! The ultimate laptop decal!',5,5,'sticker_single.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(17,'OWASP Juice Shop Temporary Tattoos (16pcs)','Get one of these <a href=\"https://www.stickeryou.com/products/owasp-juice-shop/794\" target=\"_blank\">temporary tattoos</a> to proudly wear the OWASP Juice Shop or CTF Extension logo on your skin! If you tweet a photo of yourself with the tattoo, you get a ',15,15,'tattoo.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(18,'OWASP Juice Shop Mug','Black mug with regular logo on one side and CTF logo on the other! Your colleagues will envy you!',22,22,'fan_mug.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(19,'OWASP Juice Shop Hoodie','Mr. Robot-style apparel. But in black. And with logo.',50,50,'fan_hoodie.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(20,'OWASP Juice Shop-CTF Velcro Patch','4x3.5\" embroidered patch with velcro backside. The ultimate decal for every tactical bag or backpack!',3,3,'velcro-patch.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(21,'Woodruff Syrup \"Forest Master X-Treme\"','Harvested and manufactured in the Black Forest, Germany. Can cause hyperactive behavior in children. Can cause permanent green tongue when consumed undiluted.',7,7,'woodruff_syrup.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(22,'Green Smoothie','Looks poisonous but is actually very good for your health! Made from green cabbage, spinach, kiwi and grass.',2,2,'green_smoothie.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(23,'Quince Juice (1000ml)','Juice of the <em>Cydonia oblonga</em> fruit. Not exactly sweet but rich in Vitamin C.',5,5,'quince.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(24,'Apple Pomace','Finest pressings of apples. Allergy disclaimer: Might contain traces of worms. Can be <a href=\"/#recycle\">sent back to us</a> for recycling.',1,1,'apple_pressings.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(25,'Fruit Press','Fruits go in. Juice comes out. Pomace you can send back to us for recycling purposes.',90,90,'fruit_press.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(26,'OWASP Juice Shop Logo (3D-printed)','This rare item was designed and handcrafted in Sweden. This is why it is so incredibly expensive despite its complete lack of purpose.',100,100,'3d_keychain.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(27,'Juice Shop Artwork','Unique masterpiece painted with different kinds of juice on 90g/m lined paper.',279,279,'artwork.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(28,'Global OWASP WASPY Award 2017 Nomination','Your chance to nominate up to three quiet pillars of the OWASP community ends 2017-06-30! <a href=\"https://www.owasp.org/index.php/WASPY_Awards_2017\">Nominate now!</a>',0,0,'waspy.png','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(29,'Strawberry Juice (500ml)','Sweet & tasty!',4,4,'strawberry_juice.jpeg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(30,'Carrot Juice (1000ml)','As the old German saying goes: \"Carrots are good for the eyes. Or has anyone ever seen a rabbit with glasses?\"',3,3,'carrot_juice.jpeg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(31,'OWASP Juice Shop Sweden Tour 2017 Sticker Sheet (Special Edition)','10 sheets of Sweden-themed stickers with 15 stickers on each.',19,19,'stickersheet_se.png','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(32,'Pwning OWASP Juice Shop','<em>The official Companion Guide</em> by Bjrn Kimminich available <a href=\"https://leanpub.com/juice-shop\">for free on LeanPub</a> and also <a href=\"https://pwning.owasp-juice.shop\">readable online</a>!',6,6,'cover_small.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(33,'Melon Bike (Comeback-Product 2018 Edition)','The wheels of this bicycle are made from real water melons. You might not want to ride it up/down the curb too hard.',2999,2999,'melon_bike.jpeg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(34,'OWASP Juice Shop Coaster (10pcs)','Our 95mm circle coasters are printed in full color and made from thick, premium coaster board.',20,20,'coaster.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(35,'OWASP Snakes and Ladders - Web Applications','This amazing web application security awareness board game is <a href=\"https://steamcommunity.com/sharedfiles/filedetails/?id=1969196030\">available for Tabletop Simulator on Steam Workshop</a> now!',0,0,'snakes_ladders.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(36,'OWASP Snakes and Ladders - Mobile Apps','This amazing mobile app security awareness board game is <a href=\"https://steamcommunity.com/sharedfiles/filedetails/?id=1970691216\">available for Tabletop Simulator on Steam Workshop</a> now!',0,0,'snakes_ladders_m.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(37,'OWASP Juice Shop Holographic Sticker','Die-cut holographic sticker. Stand out from those 08/15-sticker-covered laptops with this shiny beacon of 80\'s coolness!',2,2,'holo_sticker.png','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(38,'OWASP Juice Shop \"King of the Hill\" Facemask','Facemask with compartment for filter from 50% cotton and 50% polyester.',13,13,'fan_facemask.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(39,'Juice Shop Adversary Trading Card (Common)','Common rarity \"Juice Shop\" card for the <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSecLEakawSQ56lBe2JOSbFwFYrKDCIN7Yd3iHFdQc5z8ApwdQ/viewform\">Adversary Trading Cards</a> CCG.',3,1,'ccg_common.png','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(40,'Juice Shop Adversary Trading Card (Super Rare)','Super rare \"Juice Shop\" card with holographic foil-coating for the <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSecLEakawSQ56lBe2JOSbFwFYrKDCIN7Yd3iHFdQc5z8ApwdQ/viewform\">Adversary Trading Cards</a> CCG.',100,70,'ccg_foil.png','2023-07-10 15:47:56','2023-07-10 15:47:56','2023-07-10 15:47:56'),(41,'Juice Shop \"Permafrost\" 2020 Edition','Exact version of <a href=\"https://github.com/juice-shop/juice-shop/releases/tag/v9.3.1-PERMAFROST\">OWASP Juice Shop that was archived on 02/02/2020</a> by the GitHub Archive Program and ultimately went into the <a href=\"https://github.blog/2020-07-16-gith',10000,10000,'permafrost.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(42,'Best Juice Shop Salesman Artwork','Unique digital painting depicting Stan, our most qualified and almost profitable salesman. He made a succesful carreer in selling used ships, coffins, krypts, crosses, real estate, life insurance, restaurant supplies, voodoo enhanced asbestos and courtroo',5000,5000,'artwork2.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL),(43,'OWASP Juice Shop Card (non-foil)','Mythic rare <small><em>(obviously...)</em></small> card OWASP Juice Shop\" with three distinctly useful abilities. Alpha printing, mint condition. A true collectors piece to own!',1000,1000,'card_alpha.jpg','2023-07-10 15:47:56','2023-07-10 15:47:56',NULL);
